description:
The great continent of North America is the theme for Wrap issue four. Featuring superb prints by illustrators from Toronto to Texas and NYC to LA, as well as artists from other countries. We've also packed in more articles than ever, so you get even more bang for your buck! 

Features include an interview with Grace Bonney, founder of Design*Sponge blog; an article on the revival of letterpress printing; and a look at the portfolio of New York photographer Simon Biswas. 

Issue four:

// a magazine celebrating creativity, featuring work by top illustrators and designers from around the world
// 10 sheets of exclusively designed wrapping paper
//  coordinating notecards to the prints featured in the issue
// every copy is individually hand-numbered

Limited edition of 3,000 copies

WRAP is published in the UK and printed on FSC certified paper using vegetable-based inks. There are no staples or stitches used when making issue four so each sheet can easily be taken out and reused as wrapping paper.

As our ‘Dark Days, Bright Nights’ theme suggests, there is something undeniably enchanting about the harshest of seasons; as the days are docked by darkness, shining lights illuminate our streets and homes; as the air begins to bite, we light our fires; and as cold clamps the earth we savor the warmth of family and friendship all the more, and fling snowballs at each other. Brilliant. This is what we asked a talented troupe of designers to celebrate and we hope you enjoy the nine double page prints created exclusively for Wrap issue three. Go ahead and pull them out!

